      __w9L = np.array([1.082508822446903E-5, 0.0009742579402022127, 0.01753664292363983, 0.1091168893026478, 0.2864318344194504, 0.343718201303341, 0.190954556279633, 0.04676438112970707, 0.004384160730909272, 0.0001082508822449945])

